[Form]
public class WHSBillOfLading extends FormRun
{
    WHSBillOfLadingForm whsBillOfLadingForm;
    WHSLoadId           loadId;

}

public void init()
{
    super();

    whsBillOfLadingForm = WHSBillOfLadingForm::newFromBOL(element.args().record(), WHSBillOfLading_DS);

    whsBillOfLadingForm.setFilter();
}

public WHSLoadId parmLoadId(WHSLoadId _loadId = loadId)
{
    loadId = _loadId;

    return loadId;
}

public int active()
{
    int ret;

    element.enableFields();

    ret = super();

    return ret;
}

public void modified()
{
    super();

    if (WHSBillOfLading.MasterBillOfLadingId)
    {
        WHSBillOfLading.MasterBillOfLadingId = '';
    }

    element.enableFields();
}

/// <summary>
/// Upon closing, build a master bill of lading and refresh the bill of lading data source when a load Id has been specified.
/// </summary>
/// <param name = "_formRun"></param>
public void dialogClosed(xFormRun _formRun)
{
    super(_formRun);

    if (loadId)
    {
        whsBillOfLadingForm.buildMasterBOL(loadId);

        loadId = '';

        WHSBillOfLading_ds.refresh();
    }
}

void clicked()
{
    MenuFunction whsBillOfLadingController = new MenuFunction(menuitemOutputStr(WHSBillOfLading), MenuItemType::Output);
    Args args = new Args();
    args.record(WHSBillOfLading);
    args.caller(this);
    args.parmEnum(NoYes::Yes); // Show the print dialog
    whsBillOfLadingController.run(args);
}
